import axios from 'axios'

const url = process.env.REACT_APP_URL_BASE;

async function getCollaboration (req,res){
    return axios
        .get(url + '/collaborator/get')
        .then((response) => {
            return response.data.result;
        })
        .catch((error) => {
            return error
        })
}

module.exports = {
    getCollaboration
}
